What an incredible trip.  From the beginning, it was non-stop fun and action. Starting in Idaho at my long time mecahic, @thereal_goose shop.  Then from there, each and every route to our nightly destinations, were absolutely unreal. The views, conditions and all of the above were just epic!  To all of the crew who joined, I appreciate all of you and you guys are what made the trip even that much better. You can read all about it in this month’s @upshift_online issue. The link is in my bio. I’m already amped for the planning of next years trip! 
